import React, { useEffect, useState } from 'react'
import axios from "axios"

 const Home = () => {
    let key="Wqi9oEy3bY7UVoFKW3TIZbxhlHa2LfN94h-CF17OHfI"
    let Url=`https://api.unsplash.com/photos/?client_id=${key}`



    const [resim,setResim]=useState([])
    const [random,setRandom]=useState([])

    useEffect(()=>{
        axios.get(Url)
        .then(response=>{
            setResim(response.data)
        })
    },[key])

    console.log(resim,"resim");



    useEffect(()=>{
      const api_Link="https://api.unsplash.com/photos/random?count=5"
      axios.get(api_Link)
      .then(response=>{
          setRandom(response.data)
      })
    },[])
  return (
   <>
  <h3>Unsplash Resim</h3>
  {
    resim.map((resim,i)=>
    <img key={i} src={resim.user.profile_image} />
    )
  }
   </>
  )
}

export default Home;
